import React from 'react';

const NavigationBar = ({ onSafetyBoxClick, onCCTVClick, activePage }) => {
  return (
    <div className="fixed top-4 right-4 bg-white shadow-md rounded-lg p-4">
      <div className="text-sm text-gray-600 mb-2">
        Dashboard: {activePage}
      </div>
      <div className="flex space-x-2">
        <button 
          onClick={onSafetyBoxClick} 
          className="bg-blue-50 hover:bg-blue-100 text-blue-700 px-3 py-2 rounded-md transition-colors"
        >
          Safety Box Information
        </button>
        <button 
          onClick={onCCTVClick} 
          className="bg-green-50 hover:bg-green-100 text-green-700 px-3 py-2 rounded-md transition-colors"
        >
          Checking CCTV
        </button>
      </div>
    </div>
  );
};

export default NavigationBar;
